import React from 'react'
import './add-panel.css'

const AddPanel = ({onPanelAdd}) => {


    return (
        <div className = 'add-panel'>
            <input type="text"/>
            <button onClick = {onPanelAdd}>Add</button>
        </div>
    );
};

export default AddPanel;
